import React from "react";
import { Link, useHistory } from "react-router-dom";

function homestu() {
  return (
    <div>
      <h1>Student Homepage</h1>
      <img
        className="card-img-top"
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.youtube.com%2Fchannel%2FUCT2ilxyap4iJqkVoD6hSmhQ&psig=AOvVaw2yxNzikI8qCMKyVUakc44f&ust=1616834857063000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCNjQs7DJze8CFQAAAAAdAAAAABAD"
        alt={title}
        style={{ height: "250px" }}
      />
      <div className="col-12 col-md-4 my-2">
        <img className="card-img-top" />
        <div className="card-body">
          <h4 className="card-title">Hello</h4>
          <p className="card-text">Hi</p>
          <Link to="/" className="stretched-link"></Link>
        </div>
      </div>
    </div>
  );
}

export default homestu;
